import React from 'react';
import { Col, Row } from 'antd';
import Header from '../Header/Index';
const Index = (props) => {
    return (
        <div className="row">
            <div className="col-xl-2"><MenuBar e={3}/></div>
            <div className="col-xl-10">
                <HeaderTop/>
                <Table />
            </div>
        </div>
    );
}

export default Index;
